From the Sig website;
The P220® Compact SAS Gen 2, joining the recently updated P229® and P239® versions, features a melt treatment on frame & slide, SRT Trigger System, short trigger, SIGLITE® Night Sights, black polymer grips and (2) six round magazines. The slide features an engraved SIG SAUER® Custom Shop logo. The Generation 2 SAS is available in a Nitron or Two-Tone version. This P220 Compact pistol from the SIG SAUER Custom Shop has gone through a radical dehorning process resulting in an ultra smooth, snag free profile that’s ideal for concealed carry. 

This gun is in very good to excellent shape. Comes with all original box, papers, 2 magazines and factory grips. Also included is one 8 round with extended magazine sleeve and Hogue black G10 grips.
